import { Form, Input, Table } from 'antd';
import React, { useRef, useState } from 'react';
import { IFormRef } from '..';

type DataType = {
  name: string;
  age: number;
  id: number;
};

const App: React.FC = () => {
  const formRef = useRef<IFormRef<DataType>>(null);
  const [data, setData] = useState<{ name: string; age: number; id: number }[]>(
    [
      { name: '\u5C0F\u660E', age: 11, id: 1 },
      { name: '\u5C0F\u7EA2', age: 12, id: 2 },
      { name: '\u5C0F\u519B', age: 13, id: 3 },
    ],
  );

  const someAsyncFunction = () => {
    return new Promise((resolve) => {
      setTimeout(() => {
        resolve('loading');
      }, 1000);
    });
  };

  return (
    <div>
      <Table
        rowKey="id"
        columns={[
          {
            title: '\u540D\u5B57',
            dataIndex: 'name',
            width: 90,
          },
          {
            title: '\u5E74\u9F84',
            dataIndex: 'age',
            width: 90,
          },
          {
            title: '\u64CD\u4F5C',
            width: 90,
            render(_, record) {
              return (
                <a
                  onClick={() => {
                    formRef.current?.openModal(record);
                  }}
                >
                  \u7F16\u8F91
                </a>
              );
            },
          },
        ]}
        dataSource={data}
      />
      <ModalForm<DataType>
        ref={formRef}
        onFinish={async (value) => {
          await someAsyncFunction();
          const index = data.findIndex((i) => i.id === value.id);
          data[index] = value;
          setData([...data]);
          console.log(value, 'onFinish');
        }}
        modalProps={{
          title: 'ModalForm',
        }}
      >
        <Form.Item name="name" label="\u59D3\u540D">
          <Input />
        </Form.Item>
        <Form.Item name="age" label="\u5E74\u9F84">
          <Input />
        </Form.Item>
      </ModalForm>
    </div>
  );
};

export default App;
